Ooh wild Patagonia. This trip concludes my 7th season climbing around the mountains of the Patagonian Ice Cap.
What I have learned over the years is that the weather is always the deciding factor.  Anyone who is lucky to find good weather here, will surely be counterbalanced with equally horrid weather soon enough.  Patience and flexibility are most certainly virtues of the Patagonian climbers. Respecting the power of the glaciers, landslides, rock fall, wind exposure and one’s own vulnerability within is indeed a necessity to make calculated decisions. 

This year, the weather of February was too unstable to make a serious attempt our objective, but we made our best 
effort to learn as much about the wall as possible.  Spirits were kept high with laughter while we fought the uphill battle of heavy backpacks, 130 kilometers of hiking and an exceptionally dangerous glacier (more to come on this later). Thanks to my partners for all the hard work and effort this season . To @siebevanhee , I haven’t laughed so hard in years, to @jacopolarcher for inspiring me to become a better climber and @chrisalstrin for making sure we keep our chocolate stores full.  Hope to climb with you three again soon.

